import React, { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";
import { API_KEY } from "./constants/index";
import { BASE_URL } from "./constants/index";
//set weather state
const [weather,setWeather] = useState(true);
//Test grab the weather data
useEffect(() => {
  axios.get(`${BASE_URL}${API_KEY}&q=pittsburgh`)
  .then((res)=>{
    const weatherRes = res.data
    setWeather(res.data)
  })
  .catch((err)=>{
    console.log('error')
  });
});

function App() {
  return (
    <div className="App">
      <h2>My Daily Weather Forcast</h2>
    </div>
  );
}

export default App;
